INSERT INTO `api_conocimiento` VALUES (1,'Conjunto de los números enteros y racionales','▶ Operaciones y orden en el conjunto de los\r\nnúmeros enteros.\r\n▶ Operaciones y comparación entre números en\r\nel conjunto de los números racionales.\r\n▶ Problemas que involucren el conjunto de los\r\nnúmeros enteros y racionales en diversos\r\ncontextos.'),(2,'Porcentaje','▶ Concepto y cálculo de porcentaje.\r\n▶ Problemas que involucren porcentaje en\r\ndiversos contextos.'),(3,'Potencias y raíces enésimas','▶ Propiedades de las potencias de base racional\r\ny exponente racional.\r\n▶ Descomposición y propiedades de las raíces\r\nenésimas en los números reales.\r\n▶ Problemas que involucren potencias y raíces\r\nenésimas en los números reales en diversos\r\ncontextos.'),(4,'Expresiones algebraicas','▶ Productos notables.\r\n▶ Factorizaciones y desarrollo de\r\nexpresiones algebraicas.\r\n▶ Operatoria con expresiones algebraicas.\r\n▶ Problemas que involucren expresiones\r\nalgebraicas en diversos contextos.'),(5,'Proporcionalidad','▶ Concepto de proporción directa e inversa\r\ncon sus diferentes representaciones.\r\n▶ Problemas que involucren proporción\r\ndirecta e inversa en diversos contextos.'),(6,'Ecuaciones e inecuaciones de primer grado','▶ Resolución de ecuaciones lineales.\r\n▶ Problemas que involucren ecuaciones\r\nlineales en diversos contextos.\r\n▶ Resolución de inecuaciones lineales.\r\n▶ Problemas que involucren inecuaciones\r\nlineales en diversos contextos.'),(7,'Sistema de ecuaciones de lineales (2x2) M1','▶ Resolución de sistemas de ecuaciones\r\nlineales.\r\n▶ Problemas que involucren sistemas de\r\necuaciones lineales en diversos contextos.'),(8,'Función lineal y afín','▶ Concepto de función lineal y función afín.\r\n▶ Tablas y gráficos de función lineal y\r\nfunción afín.\r\n▶ Problemas que involucren función lineal y\r\nfunción afín en diversos contextos.'),(9,'Función cuadrática','▶ Resolución y problemas de ecuaciones de\r\nsegundo grado en diversos contextos.\r\n▶ Tablas y gráficos de la función cuadrática,\r\nconsiderando la variación de sus\r\nparámetros.\r\n▶ Puntos especiales de la gráfica de la\r\nfunción cuadrática: vértice, ceros de la\r\nfunción e intersección con los ejes.\r\n▶ Problemas que involucren la función\r\ncuadrática en diversos contextos.'),(10,'Figuras geométricas','▶ Problemas que involucren el Teorema de\r\nPitágoras en diversos contextos.\r\n▶ Perímetro y áreas de triángulos,\r\nparalelogramos, trapecios y círculos.\r\n▶ Problemas que involucren perímetro\r\ny áreas de triángulos, paralelogramos,\r\ntrapecios y círculos en diversos contextos.'),(11,'Cuerpos geométricos','▶ Área de superficies de prismas rectos con\r\ndiferentes bases y cilindros.\r\n▶ Volumen de prismas rectos con diferentes\r\nbases y cilindros.\r\n▶ Problemas que involucren área y volumen\r\nde prismas rectos y cilindros en diversos\r\ncontextos.'),(12,'Transformaciones isométricas','▶ Puntos y vectores en el plano cartesiano.\r\n▶ Rotación, traslación y reflexión de figuras\r\ngeométricas.\r\n▶ Problemas que involucren rotación,\r\ntraslación y reflexión en diversos contextos.'),(13,'Representación de datos a través de tablas y gráficos','▶ Tablas de frecuencia absoluta y relativa.\r\n▶ Tipos de gráficos que permitan\r\nrepresentar datos.\r\n▶ Problemas que involucren tablas y\r\ngráficos en diversos contextos.'),(14,'Medidas de tendencia central y rango','▶ Medidas de tendencia central y rango\r\nde uno o más grupos de datos.\r\n▶ Problemas que involucren medidas de\r\ntendencia central y rango en diversos\r\ncontextos.'),(15,'Medidas de posición','▶ Cuartiles y percentiles de uno o más\r\ngrupos de datos.\r\n▶ Diagrama de cajón para representar\r\ndistribución de datos.\r\n▶ Problemas que involucren medidas de\r\nposición en diversos contextos.'),(16,'Reglas de las probabilidades','▶ Problemas que involucren probabilidad\r\nde un evento en diversos contextos.\r\n▶ Problemas que involucren la\r\nregla aditiva y multiplicativa de\r\nprobabilidades en diversos contextos.'),(17,'Conjunto de los números reales','▶ Operaciones en el conjunto de los\r\nnúmeros reales.\r\n▶ Problemas que involucren el\r\nconjunto de los números reales en\r\ndiversos contextos.'),(18,'Matemática financiera','▶ Problemas relacionados con el\r\námbito de las finanzas, como por\r\nejemplo, AFP y jubilación, créditos\r\nhipotecarios y crédito de consumo.'),(19,'Logaritmos','▶ Relación entre potencias, raíces y\r\nlogaritmos, y sus propiedades.\r\n▶ Problemas que involucren\r\nlogaritmos en diversos contextos.'),(20,'Sistema de ecuaciones de lineales (2x2) M2','▶ Casos en los cuales un sistema tiene\r\nuna única solución, infinitas soluciones\r\no no tiene solución.'),(21,'Función potencia','▶ Gráfico de la función potencia.\r\n▶ Problemas que involucren la función\r\npotencia en diversos contextos.'),(22,'Homotecia de figuras planas','▶ Problemas que involucren\r\nhomotecia en diversos contextos.'),(23,'Razones trigonométricas en triángulos rectángulos','▶ Razones trigonométricas: seno,\r\ncoseno, y tangente\r\n▶ Problemas que involucren razones\r\ntrigonométricas en diversos\r\ncontextos.'),(24,'Medidas de dispersión','▶ Medidas de dispersión de uno o más\r\ngrupos de datos.\r\n▶ Problemas que involucren medidas de\r\ndispersión en diversos contextos.'),(25,'Probabilidad condicional','▶ Problemas que involucren\r\nprobabilidad condicional y sus\r\npropiedades en diversos contextos.'),(26,'Permutación y combinatoria','▶ Permutación y combinatoria.\r\n▶ Problemas que involucren\r\npermutación y combinatoria en\r\ndiversos contextos.'),(27,'Modelos probabilísticos','▶ Problemas que involucren modelos\r\nbinomiales en diversos contextos.'),(39,'Identificación de la información se logra al rastrear la coincidencia literal o casi literal de elementos presentes en la pregunta y en el texto','a. Extraer información\r\nexplícita del texto.\r\nb. Identificar información\r\nexplícita formulada a\r\ntravés de sinónimos y de\r\nparáfrasis.'),(40,'Establecer significados a partir de la(s) relación(es) entre las diferentes partes del texto','c. Establecer la relación\r\n(problema/solución,\r\ncategoría/ejemplo, causa/\r\nconsecuencia, etc.) entre\r\ndistintas partes o entre\r\ndistintas informaciones de\r\nun texto.\r\nd. Elaborar inferencias sobre\r\nel significado local y global\r\ndel texto a partir de marcas\r\ntextuales.\r\ne. Determinar el significado\r\nde una parte, párrafo,\r\nsección o de la globalidad\r\ndel texto.\r\nf. Sintetizar las ideas centrales\r\nde una sección o del texto.\r\ng. Identificar la jerarquía de las\r\nideas de una parte del texto.\r\nh. Reconocer la función de un\r\nelemento textual (ejemplos,\r\ncitas, figuras retóricas, etc.).'),(41,'Reflexionar y juzgar o valorar el texto, a partir del análisis de su forma o de su contenido, estableciendo relaciones entre el texto, su contexto y la posición que adopta el emisor o emisora frente a este','i. Determinar la intención\r\ncomunicativa del emisor(a)\r\no narrador(a) en función del\r\ndestinatario.\r\nj. Juzgar la información\r\npresente en el texto (como\r\nla calidad, pertinencia,\r\nsuficiencia o consistencia).\r\nk. Juzgar la forma en relación\r\ncon la información del\r\ntexto (como el registro,\r\nestructura, propósito,\r\npertinencia o calidad).\r\nl. Calificar la posición, actitud\r\no tono del emisor(a) o\r\nnarrador(a) respecto de un\r\nelemento, idea o del texto\r\ncompleto.\r\nm.Valorar la pertinencia de\r\nlos recursos lingüísticos y\r\nno lingüísticos (imagen,\r\ncolor, tipografía, disposición\r\ngráfica).\r\nn. Valorar la información\r\ntextual en relación con\r\nnuevos contextos.'),(42,'El Estado nación durante el siglo XIX en América y Europa','» Las ideas republicanas y liberales y su relación con las\r\ntransformaciones ocurridas en América y Europa durante el\r\nsiglo XIX.\r\n» Los impactos del surgimiento del Estado-nación en América y\r\nEuropa en el siglo XIX.'),(43,'El proceso de formación y organización de la República, la idea de nación, y las transformaciones sociales de finales del siglo XIX en Chile','» Características políticas y culturales de la formación de la\r\nRepública en Chile durante la primera mitad del siglo XIX.\r\n» La inserción de la economía chilena en los procesos de\r\nindustrialización del mundo atlántico y en los mercados\r\ninternacionales en el siglo XIX.\r\n» Transformaciones de la sociedad chilena en el tránsito del siglo\r\nXIX al siglo XX.'),(44,'Procesos económicos y políticos durante la primera mitad del siglo XX en Europa, América y Chile','» Nuevos modelos políticos y económicos derivados de la\r\ncrisis del Estado liberal durante la primera mitad del siglo XX:\r\ntotalitarismos europeos, populismo en América Latina e inicios\r\ndel Estado de bienestar.'),(45,'Características del nuevo orden mundial posterior a la Segunda Guerra Mundial','» La configuración de un nuevo orden mundial de posguerra, el\r\ninicio de procesos de descolonización y la creación de un nuevo\r\nmarco regulador de las relaciones internacionales (Organización\r\nde las Naciones Unidas y Declaración Universal de los Derechos\r\nHumanos).'),(46,'La sociedad chilena a mediados del siglo XX','» Caracterización de la sociedad chilena de mediados del siglo\r\nXX, considerando la extendida pobreza y su precariedad, y los\r\nimpactos de la migración del campo a la ciudad.'),(47,'La Dictadura Militar (1973-1990) y el retorno a la democracia en Chile','» Distintas interpretaciones historiográficas del Golpe de Estado\r\nde 1973 y el quiebre de la democracia en Chile.\r\n» Características del modelo económico neoliberal implementado\r\nen Chile durante la Dictadura Militar.\r\n» Violaciones sistemáticas a los Derechos Humanos y la supresión\r\ndel Estado de derecho durante la Dictadura Militar.\r\n» Factores que incidieron en el proceso de recuperación de la\r\ndemocracia durante la década de 1980.'),(48,'Estado, democracia y ciudadanía','» La democracia considerando sus fundamentos, atributos y\r\ndimensiones.\r\n» Problemáticas de la democracia y su relación con los conceptos\r\nde libertad, igualdad y solidaridad.'),(49,'Institucionalidad democrática en Chile','» Características y funcionamiento de la institucionalidad\r\ndemocrática en Chile.'),(50,'La democracia en la sociedad de la información','» Oportunidades y riesgos de los medios de comunicación masiva\r\ny del uso de las nuevas tecnologías de la información en el marco\r\nde una sociedad democrática.'),(51,'Formación económica: las personas y el funcionamiento del mercado','» El funcionamiento del mercado y los factores que pueden\r\nalterarlo.'),(52,'Modelos de desarrollo y política económica','» Impactos sociales y medioambientales de diversos modelos de\r\ndesarrollo.'),(54,'Analizar investigaciones, teorías o leyes científicas asociadas a la organización celular, y las propiedades y funciones de los organelos o estructuras celulares.','» Estructura y función de los principales organelos y\r\nestructuras celulares, en procariontes o eucariontes\r\n(animales y vegetales). Considerar: cápsula, pared\r\ncelular, membrana celular, citoesqueleto, núcleo,\r\nnucléolo, retículos endoplasmáticos, ribosomas,\r\nlisosomas, peroxisomas, complejo de Golgi,\r\nmitocondrias, cloroplastos, vacuolas, centriolos, cilios y\r\nflagelos.\r\n» Relación entre estructuras y función celular,\r\nconsiderando algunos tipos como el enterocito, la\r\ncélula muscular esquelética, la neurona y las células\r\nsecretoras pancreáticas.'),(55,'aspectos biológicos de la reproducción humana; el funcionamiento de los principales métodos de control de la natalidad; las características generales de las infecciones de transmisión sexual; las características generales del sistema inmunológico','Aspectos biológicos integrados en la sexualidad\r\nhumana. Considerar: los cambios físicos que ocurren\r\ndurante la pubertad en ambos sexos.\r\n» La participación de los gametos (ovocitos y\r\nespermatozoides) y su función en el proceso de la\r\nfecundación.\r\n» Características generales del ciclo ovárico y uterino, y\r\nsus fases.\r\n» Métodos de control de la natalidad. Considerar:\r\nlos métodos naturales (Billings, del calendario y\r\ntemperatura basal), los métodos artificiales reversibles\r\n(hormonales y de barrera) y los parcialmente reversibles\r\n(quirúrgicos).\r\n» Características generales de las infecciones de\r\ntransmisión sexual (ITS) tales como VIH, herpes,\r\ngonorrea y clamidia. Considerar: tipo de agente\r\npatógeno, mecanismo de transmisión, síntomas\r\ngenerales y medidas de prevención.\r\n» Características generales de las barreras defensivas del\r\ncuerpo humano (primarias, secundarias y terciarias).\r\nConsiderar: los tipos de defensa frente a patógenos;\r\nagentes patógenos como virus y bacterias; uso de\r\nvacunas y alteraciones de la respuesta inmunológica,\r\ncomo alergias, enfermedades autoinmunes y rechazo\r\na trasplantes de órganos.'),(56,'ivisión celular y meiosis; las concepciones y teorías acerca del origen de la diversidad de especies y la evidencia científica en que se sustentan, considerando el análisis de los principales mecanismos evolutivos que afectan la variabilidad genética y qu','» Características generales del ciclo celular. Considerar:\r\nla estructura de la cromatina, grados de compactación,\r\nlos puntos de control (G1–S, G2–M y Metafase) y su\r\nefecto sobre la progresión normal del ciclo. Las etapas\r\nde la interfase (G1, S, G2) y la mitosis (profase, metafase,\r\nanafase y telofase) y su importancia en la conservación\r\nde la información genética y en los procesos de\r\ncrecimiento, desarrollo, reparación de tejidos y cáncer.\r\n» Características generales de la meiosis. Considerar: las\r\netapas de la meiosis I y II (profase, metafase, anafase\r\ny telofase) y la contribución de este proceso a la\r\nvariabilidad genética.\r\n» La manipulación genética y su aplicación en los\r\nprocesos de generación de alimentos, detergentes,\r\nvestuario y fármacos, entre otros.\r\n» Evidencias a favor de la evolución biológica. Considerar\r\nevidencias aportadas por: la anatomía comparada\r\n(estructuras homólogas y análogas); la embriología; la\r\nbiología molecular y el registro fósil.\r\n» Aportes de científicos como Lamarck, Darwin y\r\nWallace al estudio de mecanismos evolutivos.\r\n» Fundamentos de la evolución mediante selección\r\nnatural y ejemplos.'),(57,'procesos de formación de materia orgánica en organismos autótrofos y las implicancias de estos procesos en el flujo de energía y materia en las cadenas tróficas.','» Procesos implicados en la obtención de energía y la\r\nsíntesis de moléculas orgánicas. Considerar: el rol\r\ngeneral de la fotosíntesis y la respiración celular en los\r\necosistemas; comparación entre nutrición autótrofa\r\ny heterótrofa; las características de cada etapa de la\r\nfotosíntesis (lugar en que estas etapas se desarrollan,\r\nreactantes, productos y otras moléculas que participan)\r\ny el efecto de algunas variables ambientales sobre el\r\nproceso fotosintético.\r\n» Características de las cadenas tróficas y su rol en el\r\nflujo de materia y energía en los ecosistemas.'),(58,'ondas electromagnéticas, en función de su propagación en distintos medios e interacción con distintos objetos y, además, de comprender el funcionamiento y utilidad de dispositivos tecnológicos que operan con ondas electromagnéticas.','» Elementos de las ondas electromagnéticas (longitud\r\nde onda, frecuencia, período, amplitud).\r\n» Relación entre longitud de onda, frecuencia y rapidez\r\nde propagación de una onda electromagnética.\r\n» Espectro electromagnético.\r\n» Fenómenos ondulatorios en ondas electromagnéticas\r\n(absorción, reflexión y refracción). Propagación de la\r\nluz en línea recta.\r\n» Efecto Doppler, interferencia y difracción en ondas\r\nelectromagnéticas, en términos cualitativos.\r\n» Formación de colores y dispersión.\r\n» Comportamiento de la luz en espejos (planos, cóncavos\r\ny convexos) y lentes (convergentes y divergentes),\r\nconsiderando la formación de imágenes.\r\n» Funcionamiento y utilidad de dispositivos o artefactos\r\ntecnológicos: radar, prismáticos, comunicación\r\ninalámbrica, teléfono móvil, televisor, radio, rayo láser,\r\ntelescopio reflector y refractor, radiotelescopios, fibra\r\nóptica, entre otros'),(59,'causas del movimiento traslacional de cuerpos, en distintos contextos, así como también la presión sobre la materia y, además, comprender el funcionamiento y utilidad de diversos aparatos o dispositivos tecnológicos que utilizan fuerzas.','» Leyes de Newton en cuerpos que se desplazan con\r\nvelocidad constante o aceleración constante. Diagrama\r\nde cuerpo libre.\r\n» Fuerza de roce estático y cinético debido al contacto\r\nentre superficies. Fuerza de roce con el aire en términos\r\ncualitativos.\r\n» Fuerza peso, elástica (ley de Hooke), tensión y normal,\r\nentre otras.\r\n» Presión y sus efectos sobre sólidos, líquidos y gases, en\r\ntérminos cualitativos.'),(60,'Fenómenos que afectan a la Tierra.','» Teoría de la deriva continental, sus evidencias y su\r\nrelación con la tectónica de placas.\r\n» Tectónica de placas y sus consecuencias (sismos,\r\nvolcanismo y formas de relieve).\r\n» Modelo físico del interior de la Tierra (geosfera) y su\r\nrelación con la tectónica de placas.\r\n» Clima, sus elementos (presión atmosférica,\r\ntemperatura, humedad, entre otros) y sus factores\r\n(circulación de la atmósfera y del agua, latitud, altitud,\r\ncercanía al mar, presencia de montañas, entre otros).\r\nTiempo atmosférico.\r\n» Cambio climático, su origen (efecto invernadero natural\r\ny antropogénico) y sus consecuencias (variaciones en\r\nlos patrones del nivel del mar, de temperatura, entre\r\notras). Capa de ozono y su importancia.'),(61,'tipos de circuitos eléctricos. Además de comprender el funcionamiento y utilidad de diversos aparatos o dispositivos tecnológicos que utilizan electricidad.','» Ley de Ohm en circuitos eléctricos con resistores\r\nconectados en serie, paralelo o de forma mixta.\r\n» Potencia y energía eléctrica en circuitos de corriente\r\ncontinua.\r\n» Corriente eléctrica como flujo de cargas eléctricas en\r\ncircuitos de corriente continua.\r\n» Consumo energético, eficiencia energética y potencia\r\neléctrica en artefactos y dispositivos eléctricos.\r\n» Componentes de la instalación eléctrica domiciliaria y\r\nsus funciones.'),(62,'La materia: su clasificación, organización y estudio.','» Clasificación de la materia en sustancias puras\r\n(elementos y compuestos) y mezclas.\r\n» Procedimientos de separación de mezclas\r\n(decantación, filtración, tamizado y destilación) y sus\r\naplicaciones en diversos contextos.\r\n» Propiedades físicas de los elementos (temperaturas de\r\nebullición y de fusión, masa, volumen, densidad).\r\n» Cambios físicos y químicos.\r\n» Teoría de Dalton, modelo atómico de Thomson, modelo\r\natómico de Rutherford, modelo atómico de Bohr.\r\n» Concepto de electrón, protón y neutrón. Número\r\natómico (Z) y número másico (A).\r\n» Modelos de representación de átomos o iones, según\r\nBohr.'),(63,'Propiedades del átomo de carbono y los compuestos que forma.','» Propiedades y características del átomo de carbono.\r\nTetravalencia, hibridación, tipos de enlaces (simple,\r\ndoble y triple), energía de enlace, longitud de enlace.\r\n» Modelos de representación de moléculas orgánicas\r\n(fórmula molecular, fórmula empírica, fórmula\r\ndesarrollada o expandida, fórmula condensada o\r\nsemidesarrollada, fórmula lineal o topológica, modelo\r\nde esferas y varillas y modelos compactos).\r\n» Compuestos orgánicos: hidrocarburos (alifáticos,\r\ncíclicos y aromáticos), grupos funcionales; (haluros,\r\néteres, alcoholes, sulfuros, aminas, cetonas, aldehídos,\r\nácidos carboxílicos, anhídridos, ésteres, amidas, fenoles\r\ny nitrilos) su formulación, nombres (comunes o IUPAC)\r\ny aplicaciones.'),(64,'Comportamiento de los gases, analizar la estequiometría de diversas reacciones y las leyes ponderales involucradas. Además, se evaluará la capacidad de aplicar conceptos y principios relacionados con las soluciones químicas y solubilidad.','» Gases: características, relación entre presión, volumen\r\ny temperatura. Gases y medio ambiente (efecto\r\ninvernadero, contaminación).\r\n» Leyes ponderales: Ley de conservación de la materia.\r\nLeyes de proporcionalidad definida y múltiple.\r\n» Componentes de una reacción química. Reactantes y\r\nproductos. Balance de ecuaciones químicas.\r\n» Estequiometría. Concepto, características y relaciones\r\nentre masa, masa molar y mol. Reactivo limitante y en\r\nexceso en diversas reacciones químicas.\r\n» Análisis porcentual de compuestos químicos.\r\n» Fórmula empírica y molecular.\r\n» Características de las soluciones químicas en cuanto a\r\nsus componentes y propiedades.\r\n» Unidades de concentración químicas (concentración\r\nmolar, concentración molal, fracción molar).\r\n» Unidades de concentración físicas (% m/m, % m/v y %\r\nv/v y ppm).\r\n» Concepto de dilución y determinación de\r\nconcentraciones en diluciones y en mezclas de\r\nsoluciones.\r\n» Concepto de solubilidad y factores que influyen en ella.');
